import React from 'react'
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <div className='app-logo'>
        Prakash
      </div>
      <div className='app-right'>
      Already have an account?
      </div>
    </header>
  )
}

export default Header;
